{
  "name": "Ackee",
  "description": "Self-hosted, Node.js based analytics tool for those who care about privacy",
  "keywords": [
    "server",
    "tracking",
    "analytics"
  ],
  "website": "https://ackee.electerious.com/",
  "repository": "https://github.com/electerious/Ackee",
  "env": {
    "ACKEE_USERNAME": {
      "description": "Username which will be used to log in to Ackee",
      "required": true
    },
    "ACKEE_PASSWORD": {
      "description": "Password which will be used to log in to Ackee",
      "required": true
    },
    "ACKEE_MONGODB": {
      "description": "MongoDB URI which will be used to connect a database to Ackee",
      "required": true
    },
    "ACKEE_ALLOW_ORIGIN": {
      "description": "Tracked domains which will be used on Ackee (CORS headers)",
      "required": true
    },
    "ACKEE_AUTO_ORIGIN": {
      "description": "Automatically add CORS headers for domains with fully qualified domain names as titles",
      "required": false
    },
    "ACKEE_TTL": {
      "description": "Specifies how long an Ackee TTL token is valid (Default: 3600000)",
      "required": false
    },
    "ACKEE_TRACKER": {
      "description": "Specifies a custom name for the tracking script (Default: tracker.js)",
      "required": false
    }
  }
}

#!/usr/bin/env node
'use strict'
require('dotenv').config()

const config = require('./src/utils/config')
const customTracker = require('./src/utils/customTracker')
const { index, styles, scripts, tracker, build } = require('./src/ui/index')

// Build files that are identical on every installation
if (config.isPreBuildMode === true) {
	build('dist/index.css', styles)
	build('dist/index.js', scripts)
	build('dist/tracker.js', tracker)
}

// Build files that depend on environment variables
build(`dist/index.html`, index)
if (customTracker.exists === true) build(`dist/${ customTracker.path }`, tracker)
